Earlier, I told that the From trait "allowed conversion into our types from other types" . The key word here is Into, which happens to be another trait provided by the standard library. It also happens to be the so-called reciprocal operation of the From-trait. Let's look at an example of what this means: let a = SomeStruct::from(some_value); // From<T>
let b: SomeStruct = some_value.into(); // Into<T> These both achieve the very same thing; they convert the some_value into an instance of SomeStruct . The funny thing here, is that the implementation for Into of any struct implementing From can be written as impl Into<TargetType> for SourceType { fn into(self) -> TargetType { TargetType::from(self) }
} It would be quite cumbersome to write (or copy-paste around) a lot of such implementations. Luckily, the standard library provides a blanket implementation which implements Into for anything implementing the From-trait. That is, somewhere in the standard library there is written something like: // "S may be anything implementing From for T, implement Into<T> for S"
impl<S: From<T>, T> Into<T> for S { fn into(self) -> T { T::from(self) }
} Without going any more off-topic, a couple notes about that: S: From<T> imposes a trait bound , meaning that anything used as S must satisfy that bound. impl<S: From<T>, T> looks scary, but really, we are just pulling S and T out of thin air, telling that they have this sort of relationship and then we are allowed to use those in our type definitions for the impl-block. (there are some rules on "constraining" the type parameters, but we won't cover those here)

