Like previously, declare new components: struct FrictionComponent { amount: f64,
} struct AccelerationComponent { x: f64, y: f64,
} However, for a bit of added flavor, we are going to implement From<T> trait for these new components and the previous components we had. This might be a bit of a misuse of this trait, but for sake of an example: impl From<f64> for FrictionComponent { fn from(source: f64) -> Self { FrictionComponent { amount: source } }
} What's going on? From is a trait provided by the standard library, which is as per documentation: Used to do value-to-value conversions while consuming the input value The definition for the From-trait looks something like: trait From<T> { fn from(source: T) -> Self;
} Ok, from this it is a bit easier to see what's going on. The trait provides a single associated function , which takes in something of type T and returns Self. In this case, we implemented the trait on FrictionComponent, thus in that implementation, the Self-type is FrictionComponent. Also, we provided f64 for T, so we can substitute that for the source parameter. "impl From<f64> ...": "Implement the trait From. Use f64 for the type parameter T" , thus T from the trait is substituted with f64 "...for FrictionComponent": "...the implementation is for type FrictionComponent" , thus Self from the trait means FrictionComponent Now, looking back at From<f64> implementation for the FrictionComponent, there isn't really that much anything special going on (Especially if you are familiar with generics from other languages). We just wrap the component construction into a fancy trait implementation. Likewise, we can implement From for PositionComponent from a 2-tuple of f64s impl From<(f64, f64)> for PositionComponent { fn from(source: (f64, f64)) -> Self { PositionComponent { x: source.0, y: source.1 } }
} This then allows us to write: // Previously
PositionComponent { x: 0.0, y: 0.0 };
FrictionComponent { amount: 1.0 }; // After
PositionComponent::from((0.0, 0.0));
FrictionComponent::from(1.0); ...yeah. Not much of an improvement; but it gave us an excuse to talk about traits so I count that as a win! So, the traits in essence are just something we can implement on structs to provide them with some well-defined behavior. In this case we implemented the trait which allowed conversion into our types from other types. Later on, we are going to use traits to define System with tick-method which then allows us to handle all systems equally from a SystemDispatcher. Let's not get ahead of ourselves! What we have here, is overly complex way of initializing components, but we are keeping it because I'm an idiot!
